#跨境电商[超话]#判定亚马逊账号关联的因素
#互联网# 

（1） 路由器;

（2） 邮件图片或 Flash;

（3） 电脑：主要指硬盘信息；

（4） 店铺产品信息：各店铺之间产品重复信息不要超过 30%；

（5） 浏览器指纹：比如插件、Cookies、系统字体、操作系统版本、打字方式、打字速度等等;

亚马逊账号关联（6） 账户信息：注册人姓名、信用卡持卡人姓名、收款账号信息、邮箱地址、地址信息、电话号码、密码等，都要尽可能做到互不相同，无规律可循；

（7） 网线：主要指外网 IP 地址，但由于国内 IP 多是浮动 IP，难免会出现多个账号 IP 相同的情况，所以，IP 地址仅仅是判定关联的一个因素而非唯一因素；

（8） 网卡 MAC 地址：有些卖家，基于成本的考虑，在一个账号被关闭后，电脑格式化，系统重装后重新登入新的账号，如果电脑网卡是集成的，没有禁用网卡和更换新网卡，同样容易导致关联。 http://t.cn/RxBBmh3

